import pandas as pd
import json
import numpy as np

# Load the data
file_path = '/orcd/home/002/gerarvit/Kramabench/data/environment/input/wollaston_beach_datasheet.csv'
data = pd.read_csv(file_path, header=1)

# Clean column names by stripping whitespace
data.columns = data.columns.str.strip()

# Subtask-1: Identify the columns that contain rainfall data for the past 3 days.
rainfall_columns = [col for col in data.columns if 'Day Rain' in col]
print(json.dumps({"subtask-1": rainfall_columns}, indent=4))

# Subtask-2: Identify the columns that contain Enterococcus levels.
enterococcus_columns = [col for col in data.columns if 'Enterococcus' in col]
print(json.dumps({"subtask-2": enterococcus_columns}, indent=4))

# Subtask-3: Handle the '<' and '>' symbols in the Enterococcus levels data.
def clean_enterococcus(value):
    if isinstance(value, str):
        if value.startswith('<'):
            return float(value[1:]) / 2
        elif value.startswith('>'):
            return float(value[1:])
    return float(value)

for col in enterococcus_columns:
    data[col] = data[col].apply(clean_enterococcus)

# Subtask-4: Calculate the Pearson correlation between rainfall in the past 3 days and Enterococcus levels.
# We will calculate the correlation for each Enterococcus column with the 3-Day Rain column.
correlations = {}
for e_col in enterococcus_columns:
    if '3-Day Rain' in data.columns and e_col in data.columns:
        correlation = data['3-Day Rain'].corr(data[e_col], method='pearson')
        correlations[e_col] = round(correlation, 3)

print(json.dumps({"subtask-4": correlations}, indent=4))

# Main-task: Since the question asks for the Pearson correlation between rainfall in the past 3 days and Enterococcus levels,
# we will consider the correlation for the first Enterococcus column as the answer.
if enterococcus_columns:
    main_task_answer = correlations[enterococcus_columns[0]]
    print(json.dumps({"main-task": main_task_answer}, indent=4))
else:
    print(json.dumps({"main-task": "No Enterococcus data found"}, indent=4))
